CREATE OR REPLACE FUNCTION find_emp() RETURNS TABLE(empid char(9), lname char(15)) AS $$ DECLARE pay RECORD; emp RECORD; 
BEGIN 
FOR emp in EXECUTE 'SELECT * FROM employee' LOOP 
FOR pay in EXECUTE 'SELECT * FROM payroll' LOOP 
IF emp.empid = pay.empid THEN  IF pay.salary = 189170 THEN empid := emp.empid; 
lname := emp.lname; 
RETURN NEXT; END IF; END IF; END LOOP; END LOOP; END;
 $$ LANGUAGE plpgsql; 
SELECT * FROM find_emp() AS r ORDER BY r.empid , r.lname;

